BOOK INFO:

Uniting form and function without complicated joinery or the need for a shop full of tools, this crafting guide offers step-by-step instructions and patterns for 26 unique, keepsake boxes, made exclusively with the scroll saw. Incorporating popular scrolling techniques like fretwork, segmentation, intarsia, and layering, the projects include a holiday card holder, a desktop organizer, a patriotic flag box, and themed ideas for hikers, patriots, cowboys, and poker players. Favorites from pattern designers such as John Nelson, Gary Browning, and Rick and Karen Longabaugh are included as well as many other celebrated favorites from the pages of Scroll Saw Woodworking &amp; Crafts.
